import React from "react";
import { Table } from "reactstrap";
import axios from "axios";
import Header from "../component/adminbar";
const master = (props) => {
  return (
    <div>
      <Header />
      <Table>
        <thead>
          <tr>
            <th>id</th>
            <th>성별</th>
            <th>년</th>
            <th>월</th>
            <th>일</th>
            <th>이름</th>
          </tr>
        </thead>

        <tbody>
          {props.data.map((contents, num) => (
            <>
              <tr>
                <td>{contents.id}</td>
                <td>{contents.gender}</td>
                <td>{contents.year}</td>
                <td>{contents.mon}</td>
                <td>{contents.day}</td>
                <td>{contents.time}</td>
                <td>{contents.name}</td>
              </tr>
            </>
          ))}
        </tbody>
      </Table>
    </div>
  );
};
master.getInitialProps = async function ({ query }) {
  //const url = require("url");
  //console.log(url);
  //  console.log(query.id);
  const res = await axios.get(
    "http://localhost:8001/a2FrYW90YWxr7Jy866Gc6rCA7J6F7ZWc7IKs656M",
    {}
  );
  const data = await res.data;

  console.log(data);

  console.log(`Show data fetched. Count: ${data.length}`);
  return {
    data: data,
  };
};
export default master;
